import React from "react";
import ExpenseItem from './ExpenseItem';

const Expenses = () => {
  return (
    <div>
      <ExpenseItem text={expenses[0].text} />
      <ExpenseItem text={expenses[1].text} />
    </div>
  );
};

export default Expenses;
